writing-tests/.body:
Writing testsWriting pojo-methods tests was never so easy. Using POJO-TESTER you just have to declare what class or classes you want to test and pass it to magic pojo-assertions. That's all!Basic pojo testBasic tests for Pojo classThe simpliest pojo test may look like this:import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests() {
    // given
    final Class classUnderTest = Pojo.class;

    // when

    // then
    assertPojoMethodsFor(classUnderTest).areWellImplemented();
}
It will test a Pojo class agains equals, hashCode, toString, getters and setters, as they are default testers.If your pojo-methods are well implemented the test will pass. Ortherwise exception will be thrown.Testing with AssertJ catchThrowable()If you prefer more given-when-then convention, you can use AssertJ and test may look a little bit better.import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests() {
    // given
    final Class classUnderTest = Pojo.class;

    // when
    final Throwable result = Assertions.catchThrowable(() -> assertPojoMethodsFor(classUnderTest).areWellImplemented());

    // then
    assertThat(result).isNull();
}
But remember with this solution you will lose exception message and you may not know why your pojo-methods are not well implemented.Testing by class nameIf your class is not public, you cannot access it. Solution for this problem is testing classes via their names:import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests_When_Testing_By_Name() {
    // given
    final String qualifiedClassName = "org.pojo.playground.Pojo";

    // when

    // then
    assertPojoMethodsFor(qualifiedClassName).areWellImplemented();
}
When testing by class name you need to pass fully qualified class name.Testing with ClassAndFieldPredicatePairWhen testing your classes you can pair classes and fields, that should be testes in such a class, in ClassAndFieldPredicatePair. This objects is just a facilitation to you:import pl.pojo.tester.api.ClassAndFieldPredicatePair;
import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests_Using_ClassAndFieldPredicatePair() {
    // given
    final String qualifiedClassName = "org.pojo.playground.Pojo";
    final ClassAndFieldPredicatePair classAndFieldPredicatePair = new ClassAndFieldPredicatePair(qualifiedClassName, FieldPredicate.include("a", "b"));

    // when

    // then
    assertPojoMethodsFor(classAndFieldPredicatePair).areWellImplemented();
}
Changing nested fieldsBy default, Assertions::assertPojoMethodsFor performs tests on objects with changed field values. It uses fields values changers to do that (see fields values changer). When it encouters field, that cannot be changed e.g. CustomPojo type, it just create new instance of that type and do not perform changes in that instance. When you want POJO-TESTER to recursively change fields values you have to pass all classes with their field predicates.For classes:class Pojo {
    private CustomPojo customPojo;
}

class CustomPojo {
    private int a;
}
you have to define test as follows:@Test
public void Should_Pass_All_Pojo_Tests_Changing_Fields_Recursively() {
    // given
    final ClassAndFieldPredicatePair baseClass = new ClassAndFieldPredicatePair(Pojo.class, "customPojo");
    final ClassAndFieldPredicatePair fieldClasses = new ClassAndFieldPredicatePair(CustomPojo.class, "a");

    // when

    // then
    assertPojoMethodsFor(baseClass, fieldClasses).areWellImplemented();
}
Above test means:Dear POJO-TESTER, when you create different instances of class Pojo, include field customPojo, but have on mind that this CustomPojo class has field a. And you should generate two instances of CustomPojo - with different field a values, because Pojo::equals method implementations contains customPojo.Choose kind of testsThere is no need for testing pojo-methods in class that they are not implemented.You can choose which testers you want to run via pl.pojo.tester.api.assertion.AbstractAssetion::testing method.Running testersimport pl.pojo.tester.api.assertion.Method;
import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests_Using_All_Testers() {
    // given
    final Class classUnderTest = Pojo.class;

    // when

    // then
    assertPojoMethodsFor(classUnderTest).testing(Method.GETTER, Method.SETTER, Method.TO_STRING)
                                        .testing(Method.EQUALS)
                                        .testing(Method.HASH_CODE)
                                        .areWellImplemented();
}
Set fields for testingNext step is excluding or including fields which should be tested. By default all fields are beeing tested.You can include or exclude fields using pl.pojo.tester.api.FieldPredicate which creates java 8 Predicate that accepts given fields names..Include all fields (default behavior)import static pl.pojo.tester.api.FieldPredicate.includeAllFields;
import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests_Including_All_Fields() {
    // given
    final Class classUnderTest = Pojo.class;

    // when

    // then
    assertPojoMethodsFor(classUnderTest, includeAllFields(classUnderTest)).areWellImplemented();
}
Include specified fieldsimport static pl.pojo.tester.api.FieldPredicate.include;
import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests_Including_Specified_Fields() {
    // given
    final Class classUnderTest = Pojo.class;

    // when

    // then
    assertPojoMethodsFor(classUnderTest, include("field1", "fields2")).areWellImplemented();
}
Exclude spcified fieldsimport static pl.pojo.tester.api.FieldPredicate.exclude;
import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests_Excluding_Specified_Fields() {
    // given
    final Class classUnderTest = Pojo.class;

    // when

    // then
    assertPojoMethodsFor(classUnderTest, exclude("field1", "fields2")).areWellImplemented();
}
Remember. Always prefer excluding over including as this can make your pojo-tests bug resistant. When you add new field and forget to implement e.g. equals, POJO-TESTER will catch that. If you use including, then you probably forgot to include that field in your tests.Configure field value changerPOJO-TESTERS uses fields values changers to change field value e.g. when creating different instance.You can change default fields values changer via pl.pojo.tester.api.assertion.AbstractAssetion::using method as shown below.@Test
public void Should_Pass_All_Pojo_Tests_Using_Custom_Fields_Values_Changer() {
    // given
    final Class classUnderTest = Pojo.class;
    final CustomFieldsValuesChanger customFieldsValuesChanger = new CustomFieldsValuesChanger();

    // when

    // then
    assertPojoMethodsFor(classUnderTest).using(customFieldsValuesChanger)
                                        .areWellImplemented();
}
Define custom fields values changerTo define your own fields values changer you have to extend pl.pojo.tester.internal.field.AbstractFieldValueChanger class.AbstractFieldValueChanger defines three methods that you have to override:boolean canChange(final Class type) - this methods should perform compatibility checks e.g. if class is equal to your changer type T. If you decide, that value cannot be changed, no futhers steps are taken. Methods areDifferentValues and increaseValue are not invoked.

boolean areDifferentValues(T sourceValue, T targetValue) - in this method you have to decide, wheter values are different or not. If they are equal no changes will be made. Method increaseValue is not invoked.

T increaseValue(T value, final Class type) - this method should change given value and return new one. type is given as little help, when your field is e.g. interface and value is it's implementation.

Custom fields values changer may look like this:import pl.pojo.tester.internal.field.AbstractFieldValueChanger;

public class CustomFieldsValuesChanger extends AbstractFieldValueChanger {

    @Override
    public boolean areDifferentValues(final String sourceValue, final String targetValue) {
        return sourceValue.equals(targetValue);
    }

    @Override
    protected boolean canChange(final Class type) {
        return type.equals(String.class);
    }

    @Override
    protected String increaseValue(final String value, final Class type) {
        return value + "++increased";
    }
}
Attaching custom fields values changerFields values changer uses chain of responsibility pattern which allows you to register new fields values changer to default one.import pl.pojo.tester.internal.field.AbstractFieldValueChanger;
import pl.pojo.tester.internal.field.DefaultFieldValueChanger;

final AbstractFieldValueChanger valueChanger = DefaultFieldValueChanger.INSTANCE.attachNext(customFieldsValuesChanger)
                                                                                .attachNext(customFieldsValuesChanger)
                                                                                .attachNext(customFieldsValuesChanger);
Default fields values changerDefault fields values changer is a composition of listed changers:EnumValueChanger

BooleanValueChanger

