Create class using selected constructorSometimes, you want to choose which construtor should be used to instantiate your class or what parameters should be passed. Common example is, when construcotr validates parameters and throws exceptions.To indicate what constructor to choose, POJO-TESTER needs to know three things:a class, which constructor will be chosen

constructor's parameters types

constructor's parameter

And again, defining this in POJO-TESTER is piece of cake:import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests() {
    // given
    final String qualifiedClassName = "org.pojo.playground.Pojo";
    final Object[] constructorParameters = {1, 2.0, new Object()};
    final Class[] constructorParameterTypes = {int.class, double.class, Object.class};

    // when

    // then
    assertPojoMethodsFor(qualifiedClassName).create(qualifiedClassName, constructorParameters, constructorParameterTypes)
                                            .areWellImplemented();
}
Here POJO-TESTER provides additional class, which groups construcotr's parameters types and constructor parameters:import pl.pojo.tester.api.ConstructorParameters;
import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsFor;

@Test
public void Should_Pass_All_Pojo_Tests() {
    // given
    final String qualifiedClassName = "org.pojo.playground.Pojo";
    final Object[] parameters = {1, 2.0, new Object()};
    final Class[] parameterTypes = {int.class, double.class, Object.class};
    final ConstructorParameters constructorParameters = new ConstructorParameters(parameters, parameterTypes);

    // when

    // then
    assertPojoMethodsFor(qualifiedClassName).create(qualifiedClassName, constructorParameters)
                                            .areWellImplemented();
}
Bulk pojos testingSometimes you want to test all pojos in one tests e.g. testing toString method. POJO-TESTER has possibility to testing multiple classes. In order to do that, you have to use Assertions::assertPojoMethodsForAll nstead of Assertions::assertPojoMethodsFor method:import static pl.pojo.tester.api.assertion.Assertions.assertPojoMethodsForAll;

@Test
public void Should_Pass_All_Pojo_Tests_For_All_Classes() {
    // given
    final Class classUnderTest = Pojo.class;

    // when

    // then
    assertPojoMethodsForAll(classUnderTest, classUnderTest, classUnderTest, classUnderTest).areWellImplemented();
}
Method assertPojoMethodsForAll works in a little bit other way than assertPojoMethodsFor.
This method test all classes. If it encounters field of type from given classes it will create instance of that class and change it's value recursively.E.g. You are testing two classes A and B. Class A has a field of type B. When you pass those classes to tests, POJO-TESTER will create instance of B class, change it's value generating different objects and finally, will set all those objects into class A.



