Mean BeanTesting pojos`` using Mean Bean is almost as simply as usingPOJO-TESTER` or OpenPojo. But we have to create three testers:@Test
public void Should_Test_Pojo() {
    // given
    final Class[] classesUnderTest = {Pojo_Guava_Generated_Methods.class,
                                      Pojo_Apache_Generated_Methods.class,
                                      Pojo_Lombok_Generated_Methods.class,
                                      Pojo_Standard_Generated_Methods.class};
    // when

    // then
    final HashCodeMethodTester hashCodeMethodTester = new HashCodeMethodTester();
    final EqualsMethodTester equalsMethodTester = new EqualsMethodTester();
    final BeanTester beanTester = new BeanTester();
    Arrays.stream(classesUnderTest)
          .forEach(classUnderTest -> {
              hashCodeMethodTester.testHashCodeMethod(classUnderTest);
              equalsMethodTester.testEqualsMethod(classUnderTest);
              beanTester.testBean(classUnderTest);
          });
}
Coverage ComparisonOK! Let's see at the coverage.First of all, three libraries (Smart Unit, testUtil and testUtils) have lowest code coverage as they tests only getters and setters.Next, is Open Pojo, that is loosing the fight against Mean Bean and POJO-TESTER.
Open Pojo cannot tests classes that implements custom equals, hashCodes and toString, so you cannot just use it in your project without production code modifications.Mean Bean looks pretty nice, but due to it's implementation, the coverage is unstable. 
Mean Bean generates pojo's fields values randomly, so you can have lower and bigger coverage, but always below POJO-TESTER level. 
And there is one more thing. Tests (internal, in library implementation) using Mean Beans are repeated 100 hundred times, by default.POJO-TESTER does the job. It provides stable coverage and the bigest coverage. As we can see below.
Next thing that POJO-TESTER can do, but other libraries not is testing fields recursively.
This means your tests are more sure.We've done one more code coverage reports using changing nested fields. 
From those tests, we excluded three libraries - Mean Bean, Smart Unit and TestUtil.
They just cannot perfom such a tests and thorws undefinied exceptions.Here are results:
ConclusionsHere is a quick overview of tests.Libraries like testUtil, testUtils, and smart-unit are just outdated. 
No one is implementing them. (Our definitions of implement is the more bugs are reported the more library is up to date).
Those libraries tests just setters and getters which are the least wanted and the least liable for bugs.
